import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
    {
        id: 'e1',
        title: 'Some event'
    },
    {
        id: 'e2',
        title: 'Another event'
    },
]

function EventsPage () {
    return (
        <>
            <h1>Events Page</h1>
            <ul>
                {DUMMY_EVENTS.map((event) => <Link key={event.id}>{event.title}</Link>)}
            </ul>
        </>
    )
}

export default EventsPage;
